  { id: 2, description: "Socks", quantity: 12, packed: false },
];

export default function App() {
  return <div className="app">
    <Logo />
    <Form />
    <PackingList />
    <Stats />
  </div>
}

function Logo() {
  return (
    <h1>üèùÔ∏è Far Away üß≥</h1>
  )
}

function Form() {
  return (
    <div className="add-form">
      <h3>What do you need for your trip ?</h3>
    </div>
